  \"2013-03-14T19:25:39.167243\",\n\t\"name\": \"riparian-habitats-sierra-nevada-foothill-ds304\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data are habitat polygons within
  a 200-m radius around point locations where wildlife surveys were conducted along
  19 randomly selected watercourses in the foothills of the Sierra Nevada Mountain
  Range from Butte to Calaveras counties. These wildlife surveys included point counts
  of birds (from 10-minute counts) within 100-m radius circles, and playback surveys
  of hawks and owls. Bird point count surveys were conducted between 25 March 2005
  and 30 June 2005, while the hawk and owl surveys were conducted between 28 March
  2005 and 19 July 2005. These data are from 74 sample points along the 19 watercourses.
  Habitat polygons were delineated from DOQQs and then field verified in July-August
  2005.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
